import React from 'react';
import '../../css/home.css';

const Home = () => {
  return (
    <div class="content">
      <h1 class="title">SHAREHOME</h1>
      <p class="subtitle">
        A custom party game inspired by Terrace House
      </p>
      <li class="callToAction">
        <a href="/play">Play virtually with friends right now!</a> (video conferencing not included)
      </li>
      <li class="callToAction">
        <a href="/purchase">Purchase a physical copy</a> for when social distancing becomes lame again.
      </li>
      <li class="callToAction">
        <a href="/purchase">Print a cheap paper version</a> for free.
      </li>
    </div>
  );
}

export default Home;
